import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import api from '../config/api';
import '../styles/Home.css';

const Home = () => {
  const { user } = useAuth();
  const [stats, setStats] = useState({ totalSessions: 0, totalMinutes: 0, currentStreak: 0 });
  const [recentSessions, setRecentSessions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await api.get('/sessions');
      const { sessions, stats } = response.data;
      
      setStats(stats);
      setRecentSessions(sessions.slice(0, 5));
    } catch (error) {
      console.error('Error fetching data:', error);
    } finally {
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', { month: 'short', day: 'numeric', year: 'numeric' });
  };

  const getMoodEmoji = (mood) => {
    const moodMap = {
      calm: 'üòå',
      happy: 'üòä',
      relaxed: 'üòé',
      peaceful: 'üßò',
      energized: '‚ö°',
      stressed: 'üò∞',
      anxious: 'üòü'
    };
    return moodMap[mood.toLowerCase()] || 'üòä';
  };

  if (loading) {
    return (
      <div className="home-container">
        <div className="loading">Loading your dashboard...</div>
      </div>
    );
  }

  return (
    <div className="home-container">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>Welcome back, {user?.name}! üëã</h1>
          <p className="hero-subtitle">
            Take a moment to breathe and find your calm
          </p>
          <Link to="/exercises" className="btn btn-hero">
            Start Breathing Exercise
          </Link>
        </div>
      </section>

      {/* Stats Section */}
      <section className="stats-section">
        <h2>Your Progress</h2>
        <div className="stats-grid">
          <div className="stat-card">
            <div className="stat-icon">üìä</div>
            <div className="stat-value">{stats.totalSessions}</div>
            <div className="stat-label">Total Sessions</div>
          </div>

          <div className="stat-card">
            <div className="stat-icon">‚è±Ô∏è</div>
            <div className="stat-value">{stats.totalMinutes}</div>
            <div className="stat-label">Minutes Practiced</div>
          </div>

          <div className="stat-card">
            <div className="stat-icon">üî•</div>
            <div className="stat-value">{stats.currentStreak}</div>
            <div className="stat-label">Week Streak</div>
          </div>
        </div>
      </section>

      {/* Recent Sessions */}
      <section className="recent-sessions">
        <div className="section-header">
          <h2>Recent Sessions</h2>
          <Link to="/tracker" className="link-view-all">View All ‚Üí</Link>
        </div>

        {recentSessions.length === 0 ? (
          <div className="empty-state">
            <p>No sessions yet. Start your first breathing exercise!</p>
            <Link to="/exercises" className="btn btn-secondary">
              Get Started
            </Link>
          </div>
        ) : (
          <div className="sessions-list">
            {recentSessions.map((session) => (
              <div key={session._id} className="session-card">
                <div className="session-header">
                  <div className="session-type">
                    <span className="exercise-badge">{session.exerciseType}</span>
                    <span className="session-duration">{session.duration} min</span>
                  </div>
                  <div className="session-mood">
                    {getMoodEmoji(session.mood)} {session.mood}
                  </div>
                </div>
                <div className="session-date">{formatDate(session.createdAt)}</div>
                {session.notes && (
                  <div className="session-notes">{session.notes}</div>
                )}
              </div>
            ))}
          </div>
        )}
      </section>

      {/* Quick Actions */}
      <section className="quick-actions">
        <h2>Quick Actions</h2>
        <div className="actions-grid">
          <Link to="/exercises" className="action-card">
            <div className="action-icon">üßò</div>
            <h3>Practice</h3>
            <p>Start a breathing exercise</p>
          </Link>

          <Link to="/tracker" className="action-card">
            <div className="action-icon">üìà</div>
            <h3>Track</h3>
            <p>View your progress</p>
          </Link>

          <Link to="/resources" className="action-card">
            <div className="action-icon">üìö</div>
            <h3>Learn</h3>
            <p>Explore resources</p>
          </Link>

          <Link to="/feedback" className="action-card">
            <div className="action-icon">üí¨</div>
            <h3>Feedback</h3>
            <p>Share your thoughts</p>
          </Link>
        </div>
      </section>
    </div>
  );
};

export default Home;
